import React from 'react';

const services = [
  {
    title: 'Apply for SIN (Social Insurance Number)',
    description: 'We help you apply for your SIN so you can legally work and access government services in Canada.'
  },
  {
    title: 'Open a Canadian Bank Account',
    description: 'Guidance on choosing a bank, opening an account, and managing your finances.'
  },
  {
    title: 'Get a Local SIM Card',
    description: 'Compare telecom providers and get set up with a Canadian phone number.'
  },
  {
    title: 'Apply for a Health Card (MSP/OHIP)',
    description: 'Step-by-step support for registering with your province’s healthcare program.'
  },
  {
    title: 'Learn About Public Transit (Compass/Presto)',
    description: 'Learn how to use local buses and trains with transit cards like Compass or Presto.'
  },
  {
    title: 'Build Your Credit History',
    description: 'Start with a secure credit card and learn how to establish good credit in Canada.'
  },
  {
    title: 'Start Looking for Housing',
    description: 'Help with finding rental properties, understanding leases, and connecting with landlords.'
  },
  {
    title: 'Register for Newcomer Orientation Programs',
    description: 'Join free workshops and support programs to learn about life and opportunities in Canada.'
  }
];

export default function ArrivalServices() {
  return (
    <div className="min-h-screen bg-gray-100 py-10 px-6">
      <div className="max-w-6xl mx-auto bg-white shadow rounded-lg p-8">
        <h1 className="text-3xl font-bold text-gray-800 mb-8">
          Things to Do When You Arrive in Canada
        </h1>

        <div className="grid grid-cols-1 sm:grid-cols-2 gap-6">
          {services.map((service, index) => (
            <div
              key={index}
              className="p-5 border bg-white rounded-lg hover:shadow transition"
            >
              <h2 className="text-lg font-semibold text-blue-700 mb-2">{service.title}</h2>
              <p className="text-sm text-gray-600 mb-2">{service.description}</p>
              <button className="text-sm text-blue-600 hover:underline">Learn More</button>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
